import React from 'react'
import { Alert } from 'react-bootstrap'

const Footer = () => {
    return (
        <Alert variant="success">
            <Alert.Heading>Hệ thống giới thiệu việc làm</Alert.Heading>
            <p>
              Nguyễn Duy Anh Vũ &copy; 2022
            </p>
        </Alert>
    )
}

export default Footer
